CREATE TABLE `country` (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `name` varchar(64) COLLATE utf8_unicode_ci NOT NULL,
  `iso_code_2` varchar(2) COLLATE utf8_unicode_ci DEFAULT NULL,
  `iso_code_3` varchar(3) COLLATE utf8_unicode_ci DEFAULT NULL,
  `bounds_northeast_lat` double(15,12) NOT NULL DEFAULT '0.000000000000',
  `bounds_northeast_lng` double(15,12) NOT NULL DEFAULT '0.000000000000',
  `bounds_southwest_lat` double(15,12) NOT NULL DEFAULT '0.000000000000',
  `bounds_southwest_lng` double(15,12) NOT NULL DEFAULT '0.000000000000',
  `lat` double(15,12) NOT NULL DEFAULT '0.000000000000',
  `lng` double(15,12) NOT NULL DEFAULT '0.000000000000',
  `viewport_northeast_lat` double(15,12) NOT NULL DEFAULT '0.000000000000',
  `viewport_northeast_lng` double(15,12) NOT NULL DEFAULT '0.000000000000',
  `viewport_southwest_lat` double(15,12) NOT NULL DEFAULT '0.000000000000',
  `viewport_southwest_lng` double(15,12) NOT NULL DEFAULT '0.000000000000',
  `postcode_required` tinyint(4) NOT NULL DEFAULT '0',
  `status` tinyint(4) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


